export default <style>{`
	body{
		margin: 10px;
	}
	h1{
		color: #f0f0f0;
		font-size: 68pt;
		font-weight: bold;
		margin: -32px 0px;
		letter-spacing: -8px;
		text-align: right;
	}
	p{
		color: #666;
		font-size: 16pt;
		margin: 0px;
	}
`}</style>;
